INSERT INTO perfiles (id, version, archivo, nombre_imagen, tamano, texto, tipo_contenido, usuario_id) VALUES (26, 0, NULL, NULL, NULL, 'Nacido en Monterrey, Nuevo León, Mexico. Esta casado con Olivia Michel quien es oriunda de Tijuana, Baja California, México. Ambos fueron misioneros en Costa Rica específicamente en la UNADECA. Disfrutan pasar tiempo juntos, les gusta compartir tiempo con sus estudiantes y jugar con ellos. Le gusta investigar temas relacionados con algoritmos genéticos, programación multinúcleo y tecnología educativa. Imparte clases de desarrollo de software.', 'image/jpeg', 30);
